import React from 'react'
import useFormContext from '../../Hooks/useFormContext'
import FormFields from './FormFields'

function RegistrationForm() {
  const {
    step,
    setStep,
    userData,
    stepTitle,
    canSubmit,
    disabledNext, disabledPrev, hideNext, hidePrev, hideSubmit
  } = useFormContext()

  const handlePrev = () => setStep(prev => prev - 1)

  const handleNext = () => setStep(prev => prev + 1)

  const handleSubmit = e => {
    e.preventDefault()
    console.log(JSON.stringify(userData))
  }

  return (
    <form onSubmit={handleSubmit}>
      <header>{stepTitle[step]}</header>

      <FormFields />

      <div>
        <button type='button' onClick={handlePrev} disabled={disabledPrev} hidden={disabledPrev}>Previous</button>
        <button type='button' onClick={handleNext} disabled={disabledNext} hidden={hideNext}>Next</button>
        <button type='submit' disabled={!canSubmit} hidden={hideSubmit}>Register</button>
      </div>

    </form>
  )
}

export default RegistrationForm
